import React from 'react';
import { Link } from 'react-router-dom';

const CooperationNavbar = ({ cooperationName }) => {
    return (
        <nav className="navbar navbar-expand navbar-blue bg-blue">
            <Link to="/" className="navbar-brand">
                {cooperationName} {/* Показва името на кооперацията чрез пропс */}
            </Link>
  
            <div className="navbar-nav ml-auto">
                <li className="nav-item">
                    <Link to="//cooperation/1" className="nav-link">
                        Quick Create
                    </Link>
                </li>
            </div>

            <div className="navbar-nav ml-auto">
                <li className="nav-item">
                    <Link to="/" className="nav-link">
                        Floors
                    </Link>
                </li>
            </div>

            <div className="navbar-nav ml-auto">
                <li className="nav-item">
                    <Link to="/" className="nav-link">
                        All Apartments
                    </Link>
                </li>
            </div>
        </nav>
    );
};

export default CooperationNavbar;
